[board_pins mcu]
mcu: mcu
aliases:
  MMU_GEAR_UART=PG8,
  MMU_GEAR_STEP=PG7,
  MMU_GEAR_DIR=PG6,
  MMU_GEAR_ENABLE=PC7,
  MMU_GEAR_DIAG=PC6,
  MMU_SEL_UART=PD11,
  MMU_SEL_STEP=PD10,
  MMU_SEL_DIR=PD9,
  MMU_SEL_ENABLE=PD13,
  MMU_SEL_DIAG=PD12,
  BELAY_SENSOR=PC3,
  MMU_SERVO=PF1,
  MMU_ENCODER=PC0,


[mcu toolhead]
canbus_uuid: 139bae4f9cb0

[board_pins toolhead]
mcu: toolhead
aliases:
  TOOLHEAD_SENSOR=gpio29,  

[stepper_x]
step_pin: PF15
dir_pin: PF14
enable_pin: !PE9
microsteps: 64
rotation_distance: 40
endstop_pin: ^toolhead:gpio24 #tmc2209_stepper_x:virtual_endstop 
position_endstop: 256
position_max: 256
position_min: -12
homing_speed: 100
homing_retract_dist: 0

[tmc5160 stepper_x]
cs_pin: PE11
spi_bus: spi4
sense_resistor: 0.075
interpolate: false
run_current: 1.2

[stepper_y]
step_pin: PB10
dir_pin: PB11
enable_pin: !PG0
microsteps: 64
rotation_distance: 40
endstop_pin: ^PC2 #tmc2209_stepper_y:virtual_endstop
position_min: -7
position_endstop: -6
position_max: 264
homing_speed: 100
homing_retract_dist: 0

[tmc5160 stepper_y]
cs_pin: PE15
spi_bus: spi4
sense_resistor: 0.075
interpolate: false
run_current: 1.2

[stepper_z]
step_pin: PD4
dir_pin: PD3
enable_pin: !PD7
microsteps: 64
rotation_distance: 4
endstop_pin: probe:z_virtual_endstop
#position_endstop: 0
position_max: 300
position_min: -10
homing_speed: 8
#second_homing_speed: 8
#homing_retract_speed: 30
homing_retract_dist: 0

[tmc2209 stepper_z]
interpolate: false
uart_pin: PD5
run_current: 1.0

[stepper_z1]
step_pin: PC12
dir_pin: PC11
enable_pin: !PD2
microsteps: 64
rotation_distance: 4

[tmc2209 stepper_z1]
interpolate: false
uart_pin: PD0
run_current: 1.0

[stepper_z2]
step_pin: PC9
dir_pin: PC8
enable_pin: !PC10
microsteps: 64
rotation_distance: 4

[tmc2209 stepper_z2]
interpolate: false
uart_pin: PA8
run_current: 1.0

[extruder]
max_extrude_only_distance: 500.0
step_pin: toolhead:gpio5
dir_pin: toolhead:gpio4
enable_pin: !toolhead:gpio10
microsteps: 16
full_steps_per_rotation: 200
rotation_distance: 22.67895 #4.603993903555
gear_ratio:50:10
nozzle_diameter: 0.400
filament_diameter: 1.750
heater_pin: toolhead:gpio0
sensor_type: PT1000
pullup_resistor: 4583
sensor_pin: toolhead:gpio26
pressure_advance: 0.03
#control: pid
# tuned for stock hardware with 200 degree Celsius target
#pid_Kp: 21.527
#pid_Ki: 1.063
#pid_Kd: 108.982
min_temp: 0
max_temp: 300
max_extrude_cross_section: 100.0
endstop_pin: tmc2209_extruder:virtual_endstop

[tmc2209 extruder]
interpolate: true
uart_pin:toolhead:gpio6
diag_pin:toolhead:gpio7
run_current: 0.6
#diag_pin: 
driver_SGTHRS: 100

[beacon]
serial: /dev/serial/by-id/usb-Beacon_Beacon_RevH_DEB93F655154364134202020FF153523-if00
x_offset: 0 # update with offset from nozzle on your machine
y_offset: 37 # update with offset from nozzle on your machine
mesh_main_direction: x
mesh_runs: 2

[safe_z_home]
home_xy_position: 127.5, 127.5
z_hop: 3

[z_tilt]
z_positions:
 127.5, 245
 10, 10
 245, 10
#   A list of X, Y coordinates (one per line; subsequent lines
#   indented) describing the location of each bed "pivot point". The
#   "pivot point" is the point where the bed attaches to the given Z
#   stepper. It is described using nozzle coordinates (the X, Y position
#   of the nozzle if it could move directly above the point). The
#   first entry corresponds to stepper_z, the second to stepper_z1,
#   the third to stepper_z2, etc. This parameter must be provided.
points:
  #125, 180
  #129, 180
  #26, 200
  127.5, 200
  #230, 200
  245, 0
  20, 10

#   A list of X, Y coordinates (one per line; subsequent lines
#   indented) that should be probed during a Z_TILT_ADJUST command.
#   Specify coordinates of the nozzle and be sure the probe is above
#   the bed at the given nozzle coordinates. This parameter must be
#   provided.
speed: 700
#   The speed (in mm/s) of non-probing moves during the calibration.
#   The default is 50.
horizontal_move_z: 2 #30
#   The height (in mm) that the head should be commanded to move to
#   just prior to starting a probe operation. The default is 5.
retries: 5
#   Number of times to retry if the probed points aren't within
#   tolerance.
retry_tolerance: 0.025
#   If retries are enabled then retry if largest and smallest probed
#   points differ more than retry_tolerance. Note the smallest unit of
#   change here would be a single step. However if you are probing
#   more points than steppers then you will likely have a fixed
#   minimum value for the range of probed points which you can learn
#   by observing command output.

[idle_timeout]
timeout: 3600

[bed_mesh]
speed: 700
horizontal_move_z: 3 #30
mesh_min: 20, 35
mesh_max: 240, 200
probe_count: 50, 50
algorithm: bicubic
move_check_distance: 3
split_delta_z: .025
zero_reference_position: 127.5, 127.5
faulty_region_1_min: 0,0
faulty_region_1_max: 30, 10

